import React from 'react';
import Form from './component/form';
import AddressList from './component/AddressList';
import './App.css';


function App() {
  return (
    <React.Fragment>
    <h2 className='App-header'>Address Book</h2>
    <div>
      <Form></Form>
      <AddressList/>
    </div>
    </React.Fragment>
  );
}

export default App;
